import React from 'react';
import {Routes,Route,BrowserRouter} from 'react-router-dom';

import Home from './pages/Home';

export default function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='/' element={<Home />} />
      </Routes>
    </BrowserRouter>
  )
}
